  false,\n\t\"url\": null,\n\t\"notes\": \"The reconnaissance maps upon which this
  data set is based show the areal distribution of the major bottom sediment types
  covering the sea floor off eastern New England between Cape Ann and Casco Bay. The
  maps were intended as a guide to the future mapping of gravel, sand, silt, and clay,
  and because these sediments reflect the hydraulic conditions, they are also helpful
  for deducing the important sediment transport mechanisms.\",\n\t\"license_title\":
